import { layout } from './Layout.js';

function App() {
  return (
    <main style = {layout.Appmain}>
      <canvas className = "{layout.canvas}" width = {layout.canvas.width}
      height = {layout.canvas.height}>  

      </canvas>
      <label style = {layout.text}>This is a label</label>
      <div style = {layout.buttons}>
        <button style = {"position:relative; left:80px; top:2px;"
        }>^</button>
        <button style = {layout.downbutton}>v</button>
      </div>
    </main>
  );
}

export default App;
